import * as React from "react";
import { Admin, Resource } from 'react-admin';
import { PostEndereco } from './PostEndereco';
import { PostCliente } from "./PostCliente";
import { EnderecoList } from './enderecos';
import { ClienteList, ClienteCreate, ClienteEdit } from "./cliente";
import jsonServerProvider from 'ra-data-json-server';

const dataProvider = jsonServerProvider('http://localhost:8080');

const App = () => (
    <Admin dataProvider={dataProvider}>
        <Resource name="Cadastrar endereÃ§o" list={PostEndereco} />
        <Resource name="Cadastrar cliente" list={ClienteCreate} />
        <Resource name="endereco" list={EnderecoList} />
        <Resource name="cliente" list={ClienteList} />
    </Admin>
);

export default App;
